import React, { useState } from 'react';
import './DashboardPage.css';

const DashboardPage = () => {
  const [step, setStep] = useState(0); // Variable para seguir el progreso del usuario
  const [places, setPlaces] = useState([
    {
      id: 1,
      name: 'Puerto Escondido',
      location: 'Oaxaca, México',
      extension: '5 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },
    {
      id: 2,
      name: 'Huatulco',
      location: 'Oaxaca, México',
      extension: '3 km',
      type: 'playa',
      ratings: {
        cleanliness: 0,
        beauty: 0,
        accessibility: 0,
        safety: 0,
      },
    },

  ]);

  const handleNextStep = () => {
    setStep(prevStep => prevStep + 1);
  };

  const handleRatingChange = (placeId, aspect, value) => {
    setPlaces(prevPlaces =>
      prevPlaces.map(place => {
        if (place.id === placeId) {
          return {
            ...place,
            ratings: {
              ...place.ratings,
              [aspect]: value,
            },
          };
        }
        return place;
      })
    );
  };

  const renderStep = () => {
    switch (step) {
      case 0:
        return renderPlacesList();
      case 1:
        return renderRatingForm();
      default:
        return null;
    }
  };

  const renderPlacesList = () => (
    <div className="places-list">
      {places.map(place => (
        <div key={place.id} className="place">
          <h2>{place.name}</h2>
          <p><strong>Ubicación:</strong> {place.location}</p>
          <p><strong>Extensión:</strong> {place.extension}</p>
          <p><strong>Tipo:</strong> {place.type}</p>
          <button onClick={handleNextStep}>Calificar</button>
        </div>
      ))}
    </div>
  );

  const renderRatingForm = () => (
    <div className="rating-form">
      <h2>Calificar Playa</h2>
      {places.map(place => (
        <div key={place.id} className="place-rating-form">
          <h3>{place.name}</h3>
          <div className="ratings">
            <p>
              Limpieza:
              <input
                type="number"
                min="1"
                max="5"
                value={place.ratings.cleanliness}
                onChange={(e) => handleRatingChange(place.id, 'cleanliness', parseInt(e.target.value))}
              />
            </p>
            <p>
              Belleza:
              <input
                type="number"
                min="1"
                max="5"
                value={place.ratings.beauty}
                onChange={(e) => handleRatingChange(place.id, 'beauty', parseInt(e.target.value))}
              />
            </p>
            <p>
              Accesibilidad:
              <input
                type="number"
                min="1"
                max="5"
                value={place.ratings.accessibility}
                onChange={(e) => handleRatingChange(place.id, 'accessibility', parseInt(e.target.value))}
              />
            </p>
            <p>
              Seguridad:
              <input
                type="number"
                min="1"
                max="5"
                value={place.ratings.safety}
                onChange={(e) => handleRatingChange(place.id, 'safety', parseInt(e.target.value))}
              />
            </p>
          </div>
        </div>
      ))}
      <button onClick={handleNextStep}>Enviar Calificaciones</button>
    </div>
  );

  return (
    <div className="dashboard-container">
      <div className="background-image"></div>
      <div className="form-container wrapper">
        {renderStep()}
      </div>
    </div>
  );
};

export default DashboardPage;
